import React, {useState} from 'react';

const DataFetch = () => {

    let [gotData, updateData] = useState(false);

    const proceed = () => {
        updateData(true);
    }

    return (
        <div>
            <button type="submit" onClick={proceed}>Load All Database</button>

            {gotData && <button type="submit">Select City</button>}
        </div>
    )

}

export default DataFetch;
